import React from "react";
import './Home.css';
const Home = () => {
  return (
    <>
    <div className="nav">
      <h1 className="homeHead">
        <span>F</span>-UPLOAD
      </h1>
    </div>
    <div className="mainPage">
    <img src="nav-logo.jpg" alt="" />
    </div>
    </>
  );
};
export default Home;
